<p>Buscando la apertura institucional y transparencia de la información pública, la Secretaría Distrital de Integración Social realiza el proceso de Rendición de Cuentas bajo los principios de continuidad, permanencia, territorialidad y apertura institucional, promoviendo los incentivos democráticos que contribuyen a la consolidación de un gobierno abierto.</p>
